description:
Nick (Randy Spears) has just lucked into the greatest job ever... getting paid to protect a mobster boss' hot, little niece Tyra (Jessica Jaymes). He quickly learns this &quot;little niece&quot; likes to have her Italian sausage delivered piping hot! She'll seduce him, and along the way find lots of hot lesbian sex and a butt banging bonanza. It all concludes with Tyra taking a big pop in the face by her very own bodyguard!

